@anne_cap A lobster roll— quite the New England tradition. 

They come 2 styles: chilled with a bit of Mayo, celery, lemon, etc (Maine style) and hot/buttered (Connecticut style) 

I prefer the hot, buttered (CT) style, which, to many New Englanders, is blasphemy.

@libertyPickles 2 C shredded mozzarella (better not pre-shredded), 2/3 C almond flour, 1/3 C freshly grated Parmesan, 1 egg + 1 egg white. 

Mix together in bowl. Shape into 11-12” round that’s 1/4” thick on greased parchment paper and bake in preheated pan at 450° for 12-15

All the cheese

